import React from 'react'

import Search from '../Search';
import List from '../List';
import Btn from '../AddItem';

import './App.css';

const App = () => {
    const arr = [
        {name: 'Todo data 1', important: true, id: 1}, 
        {data: 'Data 2', id: 2}
    ]

    const data = arr.map(({data, id}) => {
    return  <li className='hello' key={id}>{data}</li>
    })

    return (
        <div>
            <Search/>
            <List/>
            <Btn/>
        </div>
    )
};

export default App;
